const {
    numeric,
    battery,
	illuminance,
    temperature,

} = require('zigbee-herdsman-converters/lib/modernExtend');

const reporting = require('zigbee-herdsman-converters/lib/reporting');

const definition  = {
    zigbeeModel: ['Flower_Sensor_v2a'],
    model: 'Flower_Sensor_v2a',
    vendor: 'Bacchus',
    description: 'Flower soil moisture sensor (Yandex version)',
    extend: [
        numeric({
            name: "soil_moisture",
            unit: "%",
            scale: 100,
            cluster: "msRelativeHumidity",
            attribute: "measuredValue",
            description: "Measured soil moisture value",
            access: "STATE",
            reporting: false,
        }),
        temperature({
            reporting: false,
        }),
        illuminance({
            reporting: false,
        }),
        battery({
            voltage: true,
            reporting: false,
        }),
    ],
    configure: async (device, coordinatorEndpoint) => {
        await reporting.bind(device.getEndpoint(1), coordinatorEndpoint, ["msRelativeHumidity", "genPowerCfg", "msTemperatureMeasurement", "msIlluminanceMeasurement"]);
    },

    icon: 'data:image/png;base64,',
};

module.exports = definition;
